import ExpenseItem from "./components/expenseitem";

function App() {
  const expenses = [
  {title: 'Food', amount:300,date:new Date(2023,9,13)},
  {title: 'Food', amount:300,date:new Date(2023,9,13)},
  {title: 'Food', amount:300,date:new Date(2023,9,13)},
  {title: 'Food', amount:300,date:new Date(2023,9,13)},
  {title: 'Food', amount:300,date:new Date(2023,9,13)}];
  return (
    <div>
      <ExpenseItem title="Food"></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
